import React, { useState, useEffect } from 'react';
import { useForm } from 'react-hook-form';
import { zodResolver } from '@hookform/resolvers/zod';
import * as z from 'zod';
import { motion } from 'framer-motion';
import { CheckCircle, AlertCircle } from 'lucide-react';
import { useLocation, Link, useNavigate } from 'react-router-dom';
import api from '../services/api'; // Assuming you have an api.js file with axios instance

const schema = z.object({
  name: z.string().min(2, { message: "Name must be at least 2 characters" }),
  address: z.string().min(5, { message: "Address must be at least 5 characters" }),
  phone: z.string().regex(/^\d{10}$/, { message: "Phone must be 10 digits" }),
  email: z.string().email({ message: "Invalid email address" }),
});

const OrderPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const [order, setOrder] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const { register, handleSubmit, formState: { errors } } = useForm({
    resolver: zodResolver(schema)
  });

  useEffect(() => {
    const fetchOrder = async () => {
      const orderId = location.state?.orderId;
      if (orderId) {
        try {
          setLoading(true);
          const fetchedOrder = await api.getOrderById(orderId);
          setOrder(fetchedOrder);
        } catch (error) {
          console.error('Error fetching order:', error);
          setError('Failed to fetch order details. Please try again.');
        } finally {
          setLoading(false);
        }
      }
    };

    fetchOrder();
  }, [location.state]);

  const onSubmit = async (data) => {
    try {
      setLoading(true);
      const newOrder = await api.placeOrder(data);
      setOrder(newOrder);
    } catch (error) {
      console.error('Error placing order:', error);
      setError('Failed to place order. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="text-center mt-8">Loading...</div>;
  }

  if (error) {
    return (
      <div className="container mx-auto px-4 py-8">
        <motion.div
          className="bg-red-100 border-l-4 border-red-500 text-red-700 p-4 mb-6"
          initial={{ opacity: 0, x: -50 }}
          animate={{ opacity: 1, x: 0 }}
        >
          <div className="flex items-center">
            <AlertCircle className="mr-2" />
            <p>{error}</p>
          </div>
        </motion.div>
      </div>
    );
  }

  if (order) {
    return (
      <div className="container mx-auto px-4 py-8">
        <motion.div
          className="max-w-md mx-auto mt-8 p-6 bg-white rounded-lg shadow-lg text-center"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <CheckCircle className="text-green-500 w-16 h-16 mx-auto mb-4" />
          <h2 className="text-2xl font-bold mb-4">Order Placed Successfully!</h2>
          <p className="mb-4">Your order ID is: <span className="font-semibold">{order.id}</span></p>
          <p className="mb-6">Thank you for your order. You can track your delivery status on the tracking page.</p>
          <div className="space-y-4">
            <Link to={`/track-order/${order.id}`} className="block">
              <motion.button
                className="bg-green-500 text-white px-6 py-2 rounded-full hover:bg-green-600 transition-colors w-full"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                Track Order
              </motion.button>
            </Link>
            <Link to="/menu" className="block">
              <motion.button
                className="bg-blue-500 text-white px-6 py-2 rounded-full hover:bg-blue-600 transition-colors w-full"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                Return to Menu
              </motion.button>
            </Link>
          </div>
        </motion.div>
      </div>
    );
  }

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
      className="container mx-auto px-4 py-8"
    >
      <form onSubmit={handleSubmit(onSubmit)} className="max-w-md mx-auto">
        <h2 className="text-2xl font-bold mb-6">Complete Your Order</h2>
        <div className="mb-4">
          <label htmlFor="name" className="block text-gray-700 mb-2">Name:</label>
          <input
            {...register("name")}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
          />
          {errors.name && <p className="text-red-500 mt-1">{errors.name.message}</p>}
        </div>
        <div className="mb-4">
          <label htmlFor="email" className="block text-gray-700 mb-2">Email:</label>
          <input
            {...register("email")}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
          />
          {errors.email && <p className="text-red-500 mt-1">{errors.email.message}</p>}
        </div>
        <div className="mb-4">
          <label htmlFor="address" className="block text-gray-700 mb-2">Address:</label>
          <input
            {...register("address")}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
          />
          {errors.address && <p className="text-red-500 mt-1">{errors.address.message}</p>}
        </div>
        <div className="mb-4">
          <label htmlFor="phone" className="block text-gray-700 mb-2">Phone:</label>
          <input
          {...register("phone")}
          className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
        />
        {errors.phone && <p className="text-red-500 mt-1">{errors.phone.message}</p>}
      </div>
      
      <div className="mb-6">
        <h3 className="text-xl font-semibold mb-3">Order Summary</h3>
        {location.state?.cartItems?.map((item, index) => (
          <div key={index} className="flex justify-between items-center mb-2">
            <span>{item.name} x {item.quantity}</span>
            <span>₹{(item.price * item.quantity).toFixed(2)}</span>
          </div>
        ))}
        <div className="border-t border-gray-300 mt-2 pt-2">
          <div className="flex justify-between font-bold">
            <span>Total</span>
            <span>₹{location.state?.cartItems?.reduce((total, item) => total + item.price * item.quantity, 0).toFixed(2)}</span>
          </div>
        </div>
      </div>

      <motion.button
        type="submit"
        className="w-full bg-green-500 text-white px-4 py-2 rounded-lg hover:bg-green-600 transition-colors"
        whileHover={{ scale: 1.05 }}
        whileTap={{ scale: 0.95 }}
        disabled={loading}
      >
        {loading ? 'Processing...' : 'Place Order'}
      </motion.button>
    </form>
  </motion.div>
  );
};

export default OrderPage;
